import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, InputBase, Box, Button } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';

function Header() {
    return (
        <AppBar position="static" color="inherit" elevation={1}>
            <Toolbar>
                <Typography variant="h6" noWrap component="div" sx={{ flexGrow: 1 }}>
                    AltIndex
                </Typography>
                <Box sx={{ flexGrow: 1 }}>
                    <IconButton type="submit" sx={{ p: '10px' }} aria-label="search">
                        <SearchIcon />
                    </IconButton>
                    <InputBase
                        placeholder="Search Stocks & Cryptoâ€¦"
                        inputProps={{ 'aria-label': 'search' }}
                    />
                </Box>
                <Button color="inherit">Datasets</Button>
                <Button color="inherit">Top Stocks</Button>
                <Button color="inherit">Stock Alerts</Button>
                <Button color="inherit">AI Stock picks</Button>
                <IconButton>
                    <AccountCircle />
                </IconButton>
            </Toolbar>
        </AppBar>
    );
}

export default Header;
